import React from "react";
import { useNavigate } from "react-router";

const Error = () =>{
    // let history = useNavigate();
    return(
        <>
            <h1>404 Error Page</h1>
            <p>Sorry! Page is not Found</p>
            <button onClick={useNavigate().push("/")}>Back To Go</button>
        </>
    )

}

export default Error;
